import React from 'react';
import Navbar from './views/components/Navbar';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Home, Weather } from './views/pages/inside';
import { Login, SignUp } from './views/pages/auth';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact component={Home} />
          <Route path='/weather' component={Weather} />
          <Route path='/log-out' component={SignUp} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
